//2369. Check if There is a Valid Partition For The Array
#include <vector>
using namespace std;

class Solution {
    vector<int> dp;
public:
    bool validPartition(const vector<int>& nums) {
      dp = vector<int>(nums.size() + 1, -1);
      return dfs(nums, 0);
    }
  
    bool dfs(const vector<int> &nums, int index) {
      if (index >= nums.size())
        return true;
      
      if (dp[index] != -1)
        return dp[index];
      
      vector<int> x = {}; 
      for (int i = index; i < nums.size(); i++)  {
        x.push_back(nums[i]);
        if (condition1(x)) {
          bool flag = dfs(nums, i + 1);
          dp[i + 1] = flag;
          if (flag)
            return true;
          break;
        } 

        if (x.size() > 3)
          break;
      }
      
      x.clear();
      for (int i = index; i < nums.size(); i++)  {
        x.push_back(nums[i]);
        if (condition2(x)) {
          bool flag = dfs(nums, i + 1);
          dp[i + 1] = flag;
          if (flag)
            return true;
          break;
        } 
        if (x.size() > 3)
          break;
      }
      
      x.clear();
      for (int i = index; i < nums.size(); i++)  {
        x.push_back(nums[i]);
        if (condition3(x)) {
          bool flag = dfs(nums, i + 1);
          dp[i + 1] = flag;
          if (flag)
            return true;
          break;
        } 
        if (x.size() > 3)
          break;
      }
      return false;
    }
  
    bool condition1(vector<int> &x) {
      if (x.size() == 2 && x[0] == x[1])
        return true;
      return false;
    }
  
    bool condition2(vector<int> &x)  {
      if (x.size() == 3 && x[0] == x[1] && x[1] == x[2])
        return true;
      return false;
    }
  
    bool condition3(vector<int> &x) {
      if (x.size() == 3 && x[1] == x[0] + 1 && x[2] == x[1] + 1)
        return true; 
      return false;
    }
};

